1 1/2 xícara de farinha de amêndoas 
1 colher de chá de fermento

Modo de preparo 
No liquidificador bata a cenoura, o óleo de coco os ovos o xilitol. Desligue o liquidificador, adicione a farinha de amêndoas e o fermento, misture com uma colher. Coloque a massa na forma untada com óleo de coco. Leve ao forno e asse por 35 minutos.
